import React,{Component, Fragment} from 'react';
import { Container } from 'react-bootstrap';
import Navberr from "../components/home_component/Nav";
import Futer from '../components/home_component/Footer';
class AboutPage extends Component{
    render(){
        return (
        <Fragment>
            <Navberr />
            <Container>
               <h1>আমাদের উদ্দেশ্য।</h1>
               <p>মানুষ এখানে এসে ভালো কিছু শিখবে এবং ভালো কিছু জানবে।</p>
               <p>এবং টেকনোলজি নিয়ে বিভিন্ন কোর্স এখানে ফ্রীতে দেওয়া হবে ইনশাআল্লাহ।</p>
            </Container>

            <p>Spase</p>
            <p>Spase</p>
            <p>Spase</p>
            <p>Spase</p>
            <p>Spase</p>
            <p>Spase</p>
            <p>Spase</p>
            <p>Spase</p>
            <p>Spase</p>
            <p>Spase</p>
            <p>Spase</p>
            <p>Spase</p>
            <Futer />
        </Fragment>
        )
    }
}
export default AboutPage;
